import { createContext } from 'react';

const TodoContext = createContext([
    tasks =
    {
        id: 1,
        title: "Task1",
        date: new Date().getDate() + " " + new Date().getMonth()
    },
    {
        id: 2,
        title: "Task2",
        date: new Date().getDate() + " " + new Date().getMonth()
    },
]);

export default TodoContext;
